import React from 'react'

function List() {
    const names = ['Emma', 'Alex','Britt','Clark','Diana']
    return (
        <div>
        {
            names.map(name => <h2>{name}</h2>)
        }
        </div>
    )
}

const Adoption = () => {
    return(
        <div className="container">
            <h4 className="left">Adoption</h4>
            <br></br>
            <br></br>
            <br></br>
            <p>Functionalities will be implemented on Lab 9</p>
        </div>
    )
}

export default Adoption;
